import React from 'react';
import { ProSidebar, Menu, MenuItem, SubMenu } from 'react-pro-sidebar';
import styles from '../styles/sidebar.module.css'; // Ensure your custom styles are linked correctly

const CustomSidebar = () => {
  return (
    <ProSidebar className={styles.container}>
      <Menu>
        <SubMenu title="Classes" className={styles.subMenu}>
          <MenuItem className={styles.menuItem}>Class 101</MenuItem>
          <MenuItem className={styles.menuItem}>Class 102</MenuItem>
          <MenuItem className={styles.menuItem}>Class 201</MenuItem>
          <MenuItem className={styles.menuItem}>Class 202</MenuItem>
        </SubMenu>
        <MenuItem className={styles.menuItem}>Documentation</MenuItem>
        <MenuItem className={styles.menuItem}>Calendar</MenuItem>
      </Menu>
    </ProSidebar>
  );
}

export default CustomSidebar;
